import React, { useState, useEffect } from "react";

// Render
export const Item = (props) => {
  return (
    <article>
      <img src={props.pictureUrl} alt={props.alt} />
      <h3>{props.title}</h3>
      <h4>${props.price}</h4>
    </article>
  );
};

export default Item;
